import React from 'react';

import About from './About';
import Notes from './Notes';

class Main extends React.Component {
  constructor(props) {
    super(props);
  }

  render() {
    return (
      this.props.page === 'About' ? <About /> : <Notes />
    );
  }
}

export default Main;
